import React from "react";
import { Link } from "react-router-dom";

const SideBar = () => {
  return (
    <div class="m-6 mt-20 bg-gray-300 w-fit content-center p-3 rounded-full pt-5 pb-5 fixed">
      <ul class="text-2xl flex flex-col gap-10 cursor-pointer content-center justify-center ">
        <Link to={"/"}>
          <li class="fa-solid fa-house active:bg-blue-400 hover:text-white"></li>
        </Link>
        <Link to={"/education"}>
          <li class="fa-solid fa-book active:text-white"></li>
        </Link>
        <Link to={"/projects"}>
          <li class="fa-solid fa-laptop-file active:text-white"></li>
        </Link>
        <Link to={"/contact"}>
          <li class="fa-solid fa-headset active:text-white"></li>
        </Link>
        <Link to={"/progress"}>
          <li class="fa-solid fa-bars-progress active:text-white"></li>
        </Link>
      </ul>
    </div>
  );
};

export default SideBar;
